import LoginForm from "../components/LoginForm";
import { authInitialProps } from "../lib/auth";
import Layout from "../components/Layout";

const Login = () => {
  return (
    <Layout title="Log in" {...props}>
      <LoginForm />
    </Layout>
  );
};
Login.getInitialProps = authInitialProps();
export default Login;
